"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[7369],{7369:e=>{e.exports=JSON.parse('{"lessonId":"B1_U79","title":"\u0423\u0440\u043e\u043a 79: Presente de subjuntivo: \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0424\u043e\u0440\u043c\u044b Presente de subjuntivo","content":[{"text":"<strong>Trabajes, com\xe1is</strong> \u0438 <strong>est\xe9</strong> \u2014 \u044d\u0442\u043e \u0444\u043e\u0440\u043c\u044b \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0441\u043e\u0441\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043d\u0430\u043a\u043b\u043e\u043d\u0435\u043d\u0438\u044f (presente de subjuntivo)."},{"table":{"headers":["","-ar (trabajar)","-er (comer)","-ir (vivir)"],"rows":[["(yo)","trabaj<strong>e</strong>","com<strong>a</strong>","viv<strong>a</strong>"],["(t\xfa)","trabaj<strong>es</strong>","com<strong>as</strong>","viv<strong>as</strong>"],["(usted)","trabaj<strong>e</strong>","com<strong>a</strong>","viv<strong>a</strong>"],["(\xe9l, ella)","trabaj<strong>e</strong>","com<strong>a</strong>","viv<strong>a</strong>"],["(nosotros, -as)","trabaj<strong>emos</strong>","com<strong>amos</strong>","viv<strong>amos</strong>"],["(vosotros, -as)","trabaj<strong>\xe9is</strong>","com<strong>\xe1is</strong>","viv<strong>\xe1is</strong>"],["(ustedes)","trabaj<strong>en</strong>","com<strong>an</strong>","viv<strong>an</strong>"],["(ellos, -as)","trabaj<strong>en</strong>","com<strong>an</strong>","viv<strong>an</strong>"]]}},{"text":"<strong>ATENCI\xd3N (\u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435):</strong><br><strong>dar:</strong> d\xe9, des, d\xe9, demos, deis, den<br><strong>estar:</strong> est\xe9, est\xe9s, est\xe9, estemos, est\xe9is, est\xe9n<br><strong>ser:</strong> sea, seas, sea, seamos, se\xe1is, sean<br><strong>ver:</strong> vea, veas, vea, veamos, ve\xe1is, vean"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 Presente de subjuntivo","content":[{"text":"<strong>1. \u041c\u043e\u0436\u0435\u0442 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043a \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u043c\u0443 \u0438\u043b\u0438 \u0431\u0443\u0434\u0443\u0449\u0435\u043c\u0443.</strong><br><i>Presente: Puede que Sonia <strong>est\xe9</strong> ahora en casa.<br>Futuro: Mi padre quiere que le <strong>ayude</strong> ma\xf1ana.</i>"},{"text":"<strong>2. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 \u0438 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f\u043c\u0438, \u0432\u044b\u0440\u0430\u0436\u0430\u044e\u0449\u0438\u043c\u0438 \u0436\u0435\u043b\u0430\u043d\u0438\u044f.</strong><br><i>\xbfPuedes venir a Sonia? Quiero que me <strong>ayudes</strong>.<br>Juan ha tenido un accidente. \xa1Ojal\xe1 no <strong>sea</strong> grave!</i>"},{"text":"<strong>3. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 \u0438 \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f\u043c\u0438, \u0432\u044b\u0440\u0430\u0436\u0430\u044e\u0449\u0438\u043c\u0438 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u044c.</strong><br><i>Es probable que el Boca Juniors <strong>gane</strong> la copa este a\xf1o.<br>\u2013\xbfTe ha llamado Adela? \u2013No. Quiz\xe1s me <strong>llame</strong> esta noche.</i>"},{"text":"<strong>4. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 \u0438 \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f\u043c\u0438, \u0432\u044b\u0440\u0430\u0436\u0430\u044e\u0449\u0438\u043c\u0438 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0447\u0443\u0432\u0441\u0442\u0432\u0430 (\u0440\u0430\u0434\u043e\u0441\u0442\u044c, \u0434\u043e\u0441\u0430\u0434\u0430, \u0443\u0434\u0438\u0432\u043b\u0435\u043d\u0438\u0435, \u0441\u0442\u0440\u0430\u0445...).</strong><br><i>Me gusta que <strong>se\xe1is</strong> educados, ni\xf1os.<br>Tengo miedo de que me <strong>echen</strong> del trabajo.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 79.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 Presente de subjuntivo","tasks":[{"id":"u79_1_1","sentence":"1. \xbfTienes un momento, Carlos? Quiero que me (t\xfa, ayudar) ___.","answer":"ayudes"},{"id":"u79_1_2","sentence":"2. Ha llamado el Sr. Cabrera. Quiere que (nosotros, trabajar) ___ el s\xe1bado.","answer":"trabajemos"},{"id":"u79_1_3","sentence":"3. Rosa quiere que le (yo, prestar) ___ el coche el domingo.","answer":"preste"},{"id":"u79_1_4","sentence":"4. No me gusta que (t\xfa, estar) ___ triste, Pedro.","answer":"est\xe9s"},{"id":"u79_1_5","sentence":"5. Espero que me (ustedes, escribir) ___ cuando lleguen a Santo Domingo.","answer":"escriban"},{"id":"u79_1_6","sentence":"6. Ha llamado Lolita. Quiere que (nosotros, comer) ___ fuera el domingo.","answer":"comamos"},{"id":"u79_1_7","sentence":"7. Me gusta que la gente (leer) ___.","answer":"lea"},{"id":"u79_1_8","sentence":"8. A Marisa no le gusta que Gregorio la (llamar) ___ todos los d\xedas.","answer":"llame"},{"id":"u79_1_9","sentence":"9. \xa1Ojal\xe1 (vosotros, ser) ___ felices!","answer":"se\xe1is"},{"id":"u79_1_10","sentence":"10. Espero que (llegar) ___ pronto tus amigos. Estoy cansada de esperar.","answer":"lleguen"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 79.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u043e\u0442\u0432\u0435\u0442\u044b \u0441 Presente de subjuntivo","tasks":[{"id":"u79_2_1","sentence":"1. \u2013\xbfD\xf3nde est\xe1 Bel\xe9n? \u2013No s\xe9. Puede que ___ en su despacho.","answer":"est\xe9"},{"id":"u79_2_2","sentence":"2. \u2013\xbfHas visto a Juan? \u2013No, pero quiz\xe1s lo ___ ma\xf1ana.","answer":"vea"},{"id":"u79_2_3","sentence":"3. \u2013\xbfHan llamado tus padres? \u2013No. Puede que ___ hoy.","answer":"llamen"},{"id":"u79_2_4","sentence":"4. \u2013\xbfQu\xe9 vas a estudiar, Graciela? \u2013No s\xe9 todav\xeda. Es probable que ___ Derecho.","answer":"estudie"},{"id":"u79_2_5","sentence":"5. \u2013\xbfAbren hoy los bancos? \u2013No. Puede que no ___ hoy. Es s\xe1bado.","answer":"abran"},{"id":"u79_2_6","sentence":"6. \u2013\xbfD\xf3nde est\xe1n tus hermanas? \u2013No s\xe9. Puede que ___ en el jard\xedn.","answer":"est\xe9n"},{"id":"u79_2_7","sentence":"7. \u2013\xbfCu\xe1ndo os cas\xe1is? \u2013No estamos seguros. Puede que ___ el a\xf1o que viene.","answer":"nos casemos"},{"id":"u79_2_8","sentence":"8. \u2013\xbfTe van a dar el trabajo que te prometieron? \u2013No s\xe9. Es probable que no me lo ___.","answer":"den"},{"id":"u79_2_9","sentence":"9. \u2013\xbfCu\xe1ndo se marchan ustedes? \u2013No s\xe9. Puede que ___ ma\xf1ana.","answer":"nos marchemos"},{"id":"u79_2_10","sentence":"10. \u2013\xbfVais a ganar el torneo? \u2013No s\xe9. Es probable que no lo ___.","answer":"ganemos"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 79.3: \u041f\u0435\u0440\u0435\u043f\u0438\u0448\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b, \u043a\u0430\u043a \u0432 \u043f\u0440\u0438\u043c\u0435\u0440\u0435","tasks":[{"id":"u79_3_1","sentence":"1. Agust\xedn bebe demasiada cola. A Sonia no le gusta. \u2192 A Sonia no le gusta que Agust\xedn ___ demasiada cola.","answer":"beba"},{"id":"u79_3_2","sentence":"2. Jaime y Yolanda son amables. A Pilar le gusta. \u2192 ___","answer":"A Pilar le gusta que Jaime y Yolanda sean amables"},{"id":"u79_3_3","sentence":"3. Ernestina vive en el extranjero. A Lorenzo no le gusta. \u2192 ___","answer":"A Lorenzo no le gusta que Ernestina viva en el extranjero"},{"id":"u79_3_4","sentence":"4. Jacinta es cari\xf1osa. A Mario le encanta. \u2192 ___","answer":"A Mario le encanta que Jacinta sea cari\xf1osa"},{"id":"u79_3_5","sentence":"5. Lolo da muchas fiestas. A Tom\xe1s no le gusta. \u2192 ___","answer":"A Tom\xe1s no le gusta que Lolo d\xe9 muchas fiestas"},{"id":"u79_3_6","sentence":"6. Ves muchas pel\xedculas de terror. A tu padre no le gusta. \u2192 ___","answer":"A tu padre no le gusta que veas muchas pel\xedculas de terror"},{"id":"u79_3_7","sentence":"7. Trabaj\xe1is mucho. A vuestro profesor le encanta. \u2192 ___","answer":"A vuestro profesor le encanta que trabaj\xe9is mucho"}]}]}')}}]);